import React from "react";
import { ChatEngine } from "react-chat-engine";

import {
  chat_projectid,
  giaimadulieu,
  private_key_chatroom,
} from "../security";

import {
  ChatEngineWrapper,
  Socket,
  ChatList,
  ChatFeed,
  ChatSettings,
} from "react-chat-engine";
import { useState } from "react";
import { Col } from "react-grid-system";

const ChatListExample = () => {
  const [username, setUsername] = useState("");
  const email_encoded = localStorage.getItem("email");
  const password_encoded = localStorage.getItem("password");

  const email_decoded = giaimadulieu(email_encoded);
  const password_decoded = giaimadulieu(password_encoded);

  function createDirectChat(creds) {
    // getOrCreateChat(
    //   creds,
    //   { is_direct_chat: true, usernames: [username] },
    //   () => setUsername("")
    // );
  }

  function renderChatForm(creds) {
    return (
      <div>
        <input
          placeholder="Username"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
        <button onClick={() => createDirectChat(creds)}>Create</button>
      </div>
    );
  }

  return (
    <ChatEngineWrapper>
      <Socket
        projectID={chat_projectid}
        userName={email_decoded}
        userSecret={password_decoded}
      />

      <Col xs={0} sm={3}>
        <ChatList />
      </Col>

      <Col xs={12} sm={6}>
        <ChatFeed />
      </Col>

      <Col xs={0} sm={3}>
        <ChatSettings />
      </Col>
    </ChatEngineWrapper>
  );
};

export default ChatListExample;
